import classes from "./postTech.module.css";

function PostTech(props) {
    return (
        <div className={classes.postTech}>
            {props.postTech.map((tech) => <div key={tech} className={classes.techBubble}>{tech}</div>)}
        </div>
    );
}

export default PostTech;
